import './App.scss';
import {Routes,Route,Router} from 'react-router-dom'
import Layout from './components/Layout'
import Home from './components/Home';



//Defining routes that will be used to make the site 
function App() {
  return (

      <Routes>
        <Route path="/" element={<Layout />} >
          <Route  element={<Home />} />
      </Route> 


      </Routes>

  )
}




export default App;
